sys_variable_value.value:
(function execute(inputs, outputs) {
  // ... code ...
  if (inputs.status_code == '200') {
    var responseObj = JSON.parse(inputs.response_body);
    outputs.bid = responseObj.bid;
    outputs.ask = responseObj.ask;
    outputs.volume_btc = responseObj.volume.BTC;
    outputs.volume_usd = responseObj.volume.USD;
    outputs.timestamp = responseObj.volume.timestamp;
    outputs.last = responseObj.last;
  }
})(inputs, outputs);

